import './index.scss'
import AnimatedLetters from "../AnimatedLetters";
import { useState } from 'react';

const Projects = () => {

    const [letterClass, setLetterClass] = useState('text-animate');

    return (
        <div className="container about-page">
            <div className="text-zone">
                <h1>
                    <AnimatedLetters  letterClass = {letterClass}
                        strArray={['P','r','o','j','e', 'c', 't', 's']} 
                        idx={15}
                    />
                </h1>
                <p>I'm an enthusiastic web developer looking for a role to continue developing skills in the field of
                web development and to gain experience working in a professional environment.</p>

                <p>Possess 5 years of experience, with proficiency in PHP, Magento 2 CMS, and Laravel 
                framework, as well as experience with NodeJS, and ExpressJs framework, MongoDB, Mongoose.Currently, learning Python and Reactjs.</p>

                <p>I am eager to learn and apply new skills, take on new challenges, 
                and contribute to the success of the company.</p>
            </div>
        </div>
    )
}

export default Projects;
